import {Express, Request, Response} from "express";

// Placeholder Base64 string for a 120x120 PNG logo (replace with actual logo)
const logoBase64 : string = ""; // Replace with real 120x120 PNG Base64

export function setupYandexIconRoute(app: Express) {
    app.get('/yandex-logo.png', (req: Request, res: Response) => {
        console.log(`[DEBUG] Serving Yandex logo from /yandex-logo.png`);

        const imageBuffer = Buffer.from(logoBase64, 'base64'); // Extract Base64 data after "data:image/png;base64,"

        if (!imageBuffer || imageBuffer.length === 0) {
            console.error(`[DEBUG] Invalid logo data`);
            return res.status(500).send('Internal server error');
        }

        res.set('Content-Type', 'image/png');
        res.send(imageBuffer);
    });
}